import React from "react";
import Login from './Login';
import Register from './Register';
import '../assets/styles/home.css';

const Home = () => {
	return (
		<>
			<div className="container-register">
				<Register />
			</div>
			<div className="line" />
			<div className="container-login">
				<Login />
			</div>
		</>
	);
};

export default Home;
